import MainNavigation from "./MainNavigation";
import { Outlet, useNavigation } from "react-router-dom";

const Root = () => {
  const navigation = useNavigation();
  return (
    <>
      <MainNavigation />
      <main>
        {navigation}
        <Outlet />
      </main>
    </>
  );
};

export default Root;
